package Namrata;

public class Conditional {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int number=3;
		if(number == 1)
		{
			System.out.println("One");
		}
		else if(number == 2)
		{
			System.out.println("Two");
		}
		else if(number == 3)
		{
			System.out.println("Three");
		}
		else
		{
			System.out.println("No number");
		}

	}

}
